import React, { useState } from 'react';
import { GoogleOAuthProvider, GoogleLogin } from '@react-oauth/google';
import axios from 'axios';
import './App.css';

const App = () => {
  const [user, setUser] = useState(null);
  const [attendanceData, setAttendanceData] = useState([]);
  const [leaveDays, setLeaveDays] = useState(0);
  const [updatedAttendance, setUpdatedAttendance] = useState(0);
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');

  const handleLoginSuccess = async (response) => {
    console.log('Google login success', response);
    const userInfo = {
      name: 'John Doe',
      email: 'john.doe@example.com',
      rollNo: '23TCS001',
    };

    setUser(userInfo);
  };

  const fetchAttendance = async () => {
    console.log('Fetching attendance for:', username);
    try {
      const response = await axios.get(`http://localhost:5000/api/fetch-attendance`, {
        params: {
          username: username,
          password: password,
        },
      });
      console.log('Attendance data fetched:', response.data);
      setAttendanceData(response.data.attendance_data);
    } catch (error) {
      console.error("Error fetching attendance data:", error);
    }
  };

  const handleLeaveDaysChange = (event) => {
    setLeaveDays(event.target.value);
    // Calculate updated attendance based on leave days (dummy logic)
    const newAttendance = 100 - leaveDays * 0.5;
    setUpdatedAttendance(newAttendance);
  };

  return (
    <div className="app">
      <header>
        <h1>Attendance Tracker</h1>
      </header>
      <main>
        {!user ? (
          <div className="login-container">
            <h2>Please Log in with Google</h2>
            <GoogleLogin onSuccess={handleLoginSuccess} />
          </div>
        ) : (
          <div className="dashboard-container">
            <h2>Welcome, {user.name}</h2>
            <div className="myklassroom-login">
              <h3>MyKlassroom Login</h3>
              <input
                type="text"
                placeholder="MyKlassroom Username"
                value={username}
                onChange={(e) => setUsername(e.target.value)}
              />
              <input
                type="password"
                placeholder="MyKlassroom Password"
                value={password}
                onChange={(e) => setPassword(e.target.value)}
              />
              <button onClick={fetchAttendance}>Fetch Attendance Data</button>
            </div>

            <div className="attendance-table-container">
              <h3>Attendance Data</h3>
              {attendanceData.length > 0 ? (
                <table className="attendance-table">
                  <thead>
                    <tr>
                      <th>Subject Name</th>
                      <th>Subject Code</th>
                      <th>Total Hours</th>
                      <th>Hours Present</th>
                      <th>Attendance %</th>
                    </tr>
                  </thead>
                  <tbody>
                    {attendanceData.map((subject, index) => (
                      <tr key={index}>
                        <td>{subject.subject_name}</td>
                        <td>{subject.subject_code}</td>
                        <td>{subject.total_hours}</td>
                        <td>{subject.hours_present}</td>
                        <td>{subject.attendance_percentage}%</td>
                      </tr>
                    ))}
                  </tbody>
                </table>
              ) : (
                <p>No attendance data available.</p>
              )}
            </div>

            <div className="leave-analysis">
              <h3>Leave Analysis</h3>
              <label>Enter leave days:</label>
              <input
                type="number"
                value={leaveDays}
                onChange={handleLeaveDaysChange}
              />
              <p>Updated attendance after leave: {updatedAttendance}%</p>
            </div>
          </div>
        )}
      </main>
    </div>
  );
};

const AppWrapper = () => (
  <GoogleOAuthProvider clientId="YOUR_GOOGLE_CLIENT_ID">
    <App />
  </GoogleOAuthProvider>
);

export default AppWrapper;
